Рабочие новополоцкого Нафтана выдвинули свои требования:

– Отставка Александра Лукашенко с поста президента Республики Беларусь в связи с утратой доверия;
– Отставка ЦИК во главе с Лидией Ермошиной;
– Освобождение всех политзаключенных и задержанных в ходе мирных акций протеста;
– Прекращение насилия и преследования мирных граждан со стороны силовых структур;
– Расследование всех случаев насилия над протестующими (и не протестующими) и привлечение к ответственности виновных;
– Новые, прозрачные и честные выборы с привлечением международных наблюдателей.

- Чрезвычайный саммит ЕС считает, что прошедшие выборы президента в Беларуси были нечестными и не признаёт их результата;
- Против тех, кто ответственен за насилие и фальсификации введут санкции;
- ЕС выделит дополнительно €53 млн помощи белорусскому народу;
- ЕС поддерживает мирных протестующих, но считает что белорусы должны сами выбрать путь, по которому пойдет страна, и предостерегает другие страны, в частности, Россию, от внешнего воздействия.

- ЕС может включить в санкционный список самого Лукашенко

Координационный совет выбрал президиум. В него вошли: 

Светлана Алексиевич;
Лилия Власова;
Сергей Дылевский;
Максим Знак;
Ольга Ковалькова;
Мария Колесникова;
Павел Латушко.

Что известно на данный момент:

- Колесникова разорвала паспорт, но так, что погранкомитет этого не заметил;
- спокойно прошла пограничный контроль, а потом прорвала границу на машине с двумя сообщниками;
- машина угрожала безопасности пограничников, поэтому они не стали её задерживать, а задержали Колесникову, которую из неё выбросили;
- теперь Мария задержана по непонятным причинами и Лукашенко считает что это правильно.

Антон Родненков и Иван Кравцов выступили на пресс-конференции:

– когда Антон с Иваном поехали искать Колесникову, возле её дома их затолкали в бус и надели мешки на голову;
– допрашивали много часов и угрожали сроками до 12 лет;
– заставили выехать из страны, провезли по белорусской границе без остановки;
– на нейтральной территории Колесникову силой затолкали к ним в машину. Она кричала, что никуда не поедет, порвала паспорт, вылезла из машины через окно и пошла к белорусской границе;
– вся операция была нужна, чтобы вывезти Марию;
– неизвестно, где сейчас находится Колесникова, но Родненков и Кравцов считают, что она в КГБ

Европарламент принял резолюцию по Беларуси, в которой не признает результаты выборов и не будет считать Лукашенко президентом после окончания его ткущего срока.

Европарламент также рекомендовал Еврокомиссии:

• увеличить финансирование гражданского общества Беларуси;
• заморозить перевод средств государственным и контролируемым государством организациям в Беларуси;
• прекратить кредитование Европейским инвестиционным банком и ЕБРР;
• организовать конференцию для обсуждения «многомиллиардного финансового пакета» для поддержки будущих реформ в Беларуси;
• приостановить переговоры с Беларусью о приоритетах европейского партнерства;
• создать гуманитарный коридор и облегчить выдачу виз беженцам и тем, кто нуждается в медицинской помощи после насилия;
• разработать в Европе специальную стипендиальную программу для студентов, отчисленных из белорусских вузов по политическим мотивам;
• призвать не проводить Чемпионат мира по хоккею 2021 года в Беларуси.

